import React from 'react';
import Home from './Home';
import {Route, Switch} from 'react-router-dom';

const App = () => {
  return (
    <>
      <Switch>
        <Route exact path='/' component={Home}></Route>
      </Switch>
    </>
  );
}

export default App;
